import React from 'react'
import './Product.css'
const Product = ({items}) => {
  return (
    <>
    <div className="card-cantainer">
    <div className="product-card">
       {items.map((product)=>{
        return(
          <>
          <div className="card-head" >
            <div className="card">

            </div>
          </div>
          </>
        )
       })}
       </div>
    </div>
    </>
  )
}

export default Product
